import { Navbar3 } from '../../components'

const AuthSucess = ({successfulAction}) => {
  return (
    <div>
        <Navbar3/>
        <div className='login'>
          <h1>{successfulAction} successful!</h1>

        </div>
    </div>
  )
}

export default AuthSucess
